 each user\n","* **Hourly Calories** - provides data on calories burned for every hour of every day per user\n","* **Sleep Day** - provides total sleep time per day per user\n","\n","All other spreadsheets were not relevant to this study, as they just provided a further (unnecessary) breakdown of the data, did not include a large enough sample size for adequate analysis, or included only a subset of data that was already included in the \"Daily Activity\" spreadsheet.\n","\n","\n","### Importing the csv files"]},{"cell_type":"code","execution_count":2,"id":"4708a035","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-02-08T02:26:52.169898Z","iopub.status.busy":"2023-02-08T02:26:52.140289Z","iopub.status.idle":"2023-02-08T02:26:52.679274Z","shell.execute_reply":"2023-02-08T02:26:52.677515Z"},"papermill":{"duration":0.552203,"end_time":"2023-02-08T02:26:52.68155","exception":false,"start_time":"2023-02-08T02:26:52.129347","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1mRows: \u001b[22m\u001b[34m940\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m15\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m  (1): ActivityDate\n","\u001b[32mdbl\u001b[39m (14): Id, TotalSteps, TotalDistance, TrackerDistance, LoggedActivitiesDi...\n","\n","\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n","\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n","\u001b[1mRows: \u001b[22m\u001b[34m22099\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m3\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr