airlyactiveminutes\", \"lightlyactiveminutes\", \"sedentaryminutes\")\n","df1 <- data.frame(activitylevel = factor(levels, levels = levels),\n","                  meanminutes = c(23.19, 14.86, 211.2, 948.3))\n","\n","ggplot(df1, aes(x = activitylevel, y = meanminutes)) +\n","  geom_col()+\n","  labs(title=\"Average Activity Minutes Per Day\", x = \"Activity Level\", y = \"Mean Minutes\")"]},{"cell_type":"markdown","id":"7bf9bbce","metadata":{"papermill":{"duration":0.016577,"end_time":"2023-02-08T02:26:54.986615","exception":false,"start_time":"2023-02-08T02:26:54.970038","status":"completed"},"tags":[]},"source":["These findings from the chart make sense, as most of the time people will have more sedentary minutes throughout the day that any other type of activity. The interesting finding is that there were more \"very active\" minutes logged than \"fairly active\" minutes. This may suggest there may be one or more users who are extremely active that skew the results in that direction. More investigation is needed.\n","\n","\n","I want to categorize the users in 4 different categories so we can determine the proportion of **very** active, **fairly** active, **lightly** active and **sedentary** users.\n","\n","We need to create a scale to determine the limits of each activity category. The scale will be based on the data from NIH (https://pubmed.ncbi.nlm.nih.gov/14715035/)\n","\n","* **Sedentary** = Less than 5000 steps per day\n","\n","* **Lightly Active** = 5000 to 7499 steps per day\n","\n","* **Fairly Active** = 7500 to 9999 steps per day\n","\n","* **Very Active** = More than 10,000 steps per day"]},{"cell_type":"code","execution_count":14,"id":"4fa4cceb","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2023-02-08T02:26:55.021675Z","iopub.status.busy":"2023-02-08T02:26:55.019997Z","iopub.status.idle":"2023-02-08T02:26:55.092353Z","shell.execute_reply":"2023-02-08T02:26:55.09038Z"},"papermill":{"duration":0.092457,"end_time":"2023-02-08T02: