dth":420}},"output_type":"display_data"}],"source":["#Creating a new column that contains the full date and time together, then formatting the column.\n","Calories_df <- CaloriesNew1\n","\n","Calories_df$date_full <- paste(Calories_df$activitydate, Calories_df$activityhourampm, sep = ' ')\n","Calories_df$time <- as.POSIXct(Calories_df$date_full, format =  \"%m/%d/%Y %I:%M:%S %p\", tz = 'UTC')\n","\n","#Removing the columns I don't need anymore.\n","Calories_df <- Calories_df %>% select(-activitydate, -activityhourampm, -date_full)\n","\n","#I will now add a new column that represents a 24 hour time format for each hour variable.\n","Calories_df$hour_component <- as.numeric(format(Calories_df$time,'%H'))\n","\n","head(Calories_df)\n","\n","#I now need to group in ascending order by the 24 hour data, and sum the calories of each row that corresponds to each of the 24 hour components.\n","df_total <- Calories_df %>%\n","  group_by(hour_component) %>%\n","  summarise(calories_total = sum(calories))\n","\n","#Average calories burned per hour of the day.\n","df_total_avg <- Calories_df %>%\n","  group_by(hour_component) %>%\n","  summarise(calories_avg = mean(calories))\n","\n","#I can now plot my findings in a bar chart, so it will show at what hour were users most active. This can provide us with some key takeaways.\n","\n","#Average calories burned per hour of the day.\n","df_total_avg %>%\n","  ggplot(aes(x = hour_component, y = calories_avg)) +\n","  geom_bar(stat = \"identity\")+\n","  labs(title = \"When Are Users Most Active?\", subtitle = \"Hour of the day that users burn calories the most\", \n","       x = \"Hour of Day (24-hour format)\", y = \"Average Calories Burned\")+\n","  scale_x_continuous(breaks = c(00:23))"]},{"cell_type":"markdown","id":"b33f28c5","metadata":{"papermill":{"duration":0.057066,"end_time":"2023-02-08T02:26:56.643181","exception":false,"start_time":"2023-02-08T02:26:56.586115","status":"completed"},"tags":[]},"source":["#### Some findings from this data:\n","\n","* Users were **most active** between the evening hours of 5-7pm, right when most people are off of work\n","\n","* Users were **least active** between midnight and 4am. This time should coincide with when users sleep the most.\n","\n","* The **second most active** hours were at midday, between noon and 2pm. This may be because many users exercise during their lunch hours or may walk to meetings or travel to areas for lunch\n","\n","* Active hours from users:\n","  * start to **increase** dramatically at 5am\n","  * start to **decrease** in the afternoon from 3-5pm\n","  * start to **increase** dramatically again from 5-7pm\n","  * then **decreasing** dramatically starting from 8pm\n","\n","#### Key Takeaways:\n","\n","* Users activity starts to increase at 5am, suggesting users start to **rise from sleep** at that time.\n","\n","* Users remain **increasingly active** until mid afternoon, after which, peaks from 5pm until 7pm. This suggests most users **exercise or are very active** after work, either doing some sort of activity, or being active moving from their workplace to their homes\n","\n","* User activity **increases sharply** around noon. This increased acitivity is accepted as most people increase their movement around lunch time.\n","\n","* Users **are not** very active in the late evening until sleep time. This is generally typical.\n","\n","* Most users probably **fall asleep** around 11pm, when activity drops considerably.\n","\n","\n","\n","Next, I want to group the calories burned per day, and then get the average calories burned per day of the week throughout the 30day period."]},{"cell_type":"code","execution_count":19,"id":"4be4524a","metadata":{"execution":{"iopub.execute_input":"2023-02-08T02:26:56.686945Z","iopub.status.busy":"2023-02-08T02:26:56.685203Z","iopub.status.idle":"2023-02-08T02:26:56.712685Z","shell.execute_reply":"2023-02-08T02:26:56.710919Z"},"papermill":{"duration":0.053617,"end_time":"2023-02-08T02:26:56.715721","exception":false,"start_time":"2023-02-08T02:26:56.662104","status":"completed"},"tags":[]},"outputs":[],"source":["#Grouping by the activity date and totaling the calories burned.\n","calories_avg <- CaloriesNew1\n","\n","calories_avg_day1 <- calories_avg %>% \n","  group_by(activitydate) %>% \n","  summarise(tot_calories = sum(calories))"]},{"cell_type":"code","execution_count":20,"id":"649e8a5e","metadata":{"execution":{"iopub.execute_input":"2023-02-08T02:26:56.765416Z","iopub.status.busy":"2023-02-08T02:26:56.763773Z","iopub.status.idle":"2023-02-08T02:26:57.031893Z","shell.execute_reply":"2023-02-08T02:26:57.030053Z"},"papermill":{"duration":0.293612,"end_time":"2023-02-08T02:26:57.034852","exception":false,"start_time":"2023-02-08T02:26:56.74124","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeYDM9R/H8fd3jp2dvU+sm3XfpJD7KgqRXIno+iUlVyjkTJeQJDqUUs6SSAeK\nhMqRlCv3fax17X3MfH9/DGPsMfvd2Z3dfD0ff+338/nO9/v+fr4z5uV7jaKqqgAAAODWZyjs\nAgAAAJA/CHYAAAA6QbADAADQCYIdAACAThDsAAAAdIJgBwAAoBMEOwAAAJ0g2AEAAOiEzoPd\nsVXtFEUx+1W0Z+ra2LeSoihmvwqpmZ7QvGVANUVRgkoNF5ED85spitJs/oGCKPc6JROTJaBE\nucoPPv7Cyl2xBVmJg2pPqOTnoyiKweizLT7N26tLS/jTsdXZzfBLr4qKotR5cbu3K8kX3hi9\n7S/WURSl/YbT+bK07PwxpGbmt2Jmnf6KES9/Ui7u7+1YV1jlKdnOZE+u4u/jmO3nKyneKCOD\n+KMbXujTsXKJSKuPT3B48SbtH/lk7eECWC8AuKHzYFf07mdFJD3p4JcXkjJ0zf7+lIikJx2a\ndTo+Q9d3q0+JSOku3fK3GNWesGnTpt+3ndA4f6noCk7FQiznjh1YPm/qA3VL9H7zp/wtLEex\nf486kJQmIqo9bcRXRwt47be6vI9ebt85+cU3onQFF9Hlo0REUUwVbhZlMRZYSZcPTtydmJ5l\n16WDE/YneuV/HVmOf9yxRdWrtpm6YNVJW3DNerWCDVc2ff/5Y/dU6jvnL2/UAABaqXrXMMgi\nIu2/P+7amBr3h/OAUP1X/3LtstsSI8xGERmwO1ZV1X8/aSoiTT/5N++VpMbvEJGg0mNznNNR\n2I74VNfG+NN7Zo/oblYUEXl82ZG816Pd0jYlRaT4feVFJLjsi95enWOg3Lw5N/SsICK1R23z\ndiX5Iu+jl/mdc2H7N5988smas4n5V2bOki5+KyJGn6gse/Pxk5JZ7L6HRUQxmESk/fIjWc6z\ntke0iJgNioj8dDk5H9ee5Sf35SqhItJ2wvJUu6qqqmpPWfn24yJiNEfsuvmTCwAFSedH7ERk\neO1wEdkza59r4/mtr6qqWqZrdxE5MHe5a1fiuY8vpNkUg8/I6O