ar chart to visualize the average sleep minutes per weekday.\n","sleep_day_df_avg %>% \n","  ggplot(aes(x = weekday, y = sleep_total_avg))+\n","  geom_bar(stat = \"identity\", width = 0.75)+\n","  scale_x_discrete(limits = c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\"))+\n","  coord_cartesian(ylim = c(200, 475))+\n","  labs(title = \"What Day Do Users Sleep The Most?\", subtitle = \"Average sleep time per day of the week\", \n","       x = \"Day of Week\", y = \"Average Hours of Sleep\")"]},{"cell_type":"markdown","id":"b044cc66","metadata":{"papermill":{"duration":0.024878,"end_time":"2023-02-08T02:26:58.536308","exception":false,"start_time":"2023-02-08T02:26:58.51143","status":"completed"},"tags":[]},"source":["#### Key Takeaways:\n","  * The above bar graph shows us that on average, users **sleep the most** on Sunday night. This makes sense as typically most people are home Sunday evenings and aren't out very late.\n","  * It also shows us that on average, users **sleep the least** on Thursday night, which is coincidentally the day of the week that calories are burned the least.\n","  \n","\n","I would like to show the relationship between total steps vs calories burned in a day."]},{"cell_type":"code","execution_count":28,"id":"6b8d7aa3","metadata":{"execution":{"iopub.execute_input":"2023-02-08T02:26:58.587154Z","iopub.status.busy":"2023-02-08T02:26:58.58559Z","iopub.status.idle":"2023-02-08T02:27:00.389685Z","shell.execute_reply":"2023-02-08T02:27:00.387945Z"},"papermill":{"duration":1.833447,"end_time":"2023-02-08T02:27:00.393676","exception":false,"start_time":"2023-02-08T02:26:58.560229","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`geom_smooth()` using method = 'loess' and formula = 'y ~ x'\n","Warning message:\n","“\u001b[1m\u001b[22mRemoved 5 rows containing non-finite values (`stat_smooth()`).”\n","Warning message:\n","“\u001b[1m\u001b[22mR